import React from 'react'
import './Modal.css';
const Modal = ({data}) => {
  return (
    <div className='maindiv'>
        {data.map(a => {
            return <div>
            <p>{a.name} ({a.age} 'years old')</p>
            </div>
        })}
    </div> 
  )
}

export default Modal
